import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import iitiLogo from './iitilogo.png'; // Adjust path as needed

export default function Login() {
  const [formData, setFormData] = useState({ email: '', password: '' });
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add login logic (e.g., API call)
    console.log('Login:', formData);
    navigate('/Student');
  };

  return (
    <div className="login active">
      <img src={iitiLogo} alt="IITI-Logo" className="img" />
      <div className="right">
        <h1>Log In</h1>
        <form onSubmit={handleSubmit}>
          <p>
            <i className="fa-solid fa-circle-user"></i>
            <input
              type="email"
              name="email"
              placeholder="Please Enter your mail Id"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </p>
          <p>
            <i className="fa-solid fa-envelope"></i>
            <input
              type="password"
              name="password"
              placeholder="Please Enter your Password"
              value={formData.password}
              onChange={handleChange}
              required
            />
          </p>
          <Link to="/Student"><button type="submit">Submit</button></Link>
          <br />
          <Link to="/forgot-password" className="fg">
            Forgot password
          </Link>
          <p>
            Don't have an account?{' '}
            <Link to="/Userportal/Register" className="register">
              Register
            </Link>
          </p>
        </form>
      </div>
    </div>
  );
}
